  "Allegations" : "S-14-1603-15-SC01 On March 7, 2016, the Securities Division entered a Statement of Charges and Notice of Intent to Enter Order to Cease and Desist against Life Partners, Inc. (LPI); Life Partners Holdings, Inc.; Brian Pardo, R. Scott Peden; David Barr; James Billington (Billington); Kim Butler (Butler); Gary Cassill (Cassill); Michael Chapman (Chapman); Tomas Delos Santos (Delos Santos); Neal Inscoe (Inscoe); John Ley (Ley); William Meyer (Meyer); Steven Minnich (Minnich); Tim Watters (Watters); Don Wells (Wells); Alliance of Professionals for Business, Inc. (APB); NW Retirement Solutions LLC (NW Retirement Solutions); NW Safe Retirement LLC (NW Safe Retirement); Partners Portfolio Solutions, Inc. (PPS); and Strategic Insurance Services, LLC (SIS) (collectively \"Respondents\").  In the Statement of Charges, the Securities Division alleges that the Respondents violated the Securities Act of Washington through the offer and sale of approximately $17 million of Life Partners, Inc. life settlements to Washington residents from 2009 to 2014. Specifically, the Statement of Charges alleges that the Respondents violated RCW 21.20.010, the antifraud provision of the Securities Act, by misrepresenting or failing to disclose material information in connection with the sale of LPI life settlements. The Statement of Charges further alleges that the Respondents violated RCW 21.20.140, the unregistered securities provision of the Securities Act by selling unregistered securities. Finally, the Statement of Charges alleges that Billington, Butler, Cassill, Chapman, Delos Santos, Inscoe, Ley, Meyer, Minnich, Watters, Wells, APB, NW Retirement Solutions, NW Safe Retirement, PPS, and SIS violated RCW 21.20.040 by selling LPI life settlements while unregistered as a securities salesperson or broker-dealer in Washington. The Statement of Charges gives notice of the Securities Division's intent to enter an Order to Cease and Desist. Respondents have a right to request a hearing on the Statement of Charges.",
